import "../../styles/header.scss";
export default class index extends Component {
  render() {
    return (
      <div class="container">
        <div class="row">
          <div class="col-sm">Logo</div>
          <div class="col-sm">Header</div>
          <div class="col-sm">One of three columns</div>
        </div>
      </div>
    );
  }
}
